import React from "react"

import styled from "styled-components";
import { aerobic, arms, core, legs, stretches, upperBody } from "../media/SvgIcons"

const StyledDiv = styled.div`
    width:80%;
    height:300px;
    display: flex;
    flex-direction: column;
    justify-content:center;
    align-items:center;
    background-color: beige;
    border: 1px solid #0009;
    border-radius:30px;
    margin: 20px 0 20px 0;
    header{
        width:100%;
        height100px;
    }
    body{
        width:100%;
        height:auto;
        display:flex;
        justify-content: space-evenly;
        flex-wrap:wrap;
    }
`;

export default function SpecificWorkout(props) {
    const svgObject = { aerobic, arms, core, legs, stretches, upperBody };

    return (
        <StyledDiv>
            <header className="card-header">
                <h3>{props.exercise.exercisename}</h3>
            </header>
            <div>
                <p>{props.exercise.reps}</p>
                <p>{props.exercise.exerciseregion}</p>
                <p>{props.exercise.restperiod}</p>
                <p>{props.exercise.weightlifted}</p>
            </div>
        </StyledDiv>
    );
}
